// /src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import MovieList from './components/MovieList';
import ActorList from './components/ActorList';
import CharacterList from './components/CharacterList';

const App: React.FC = () => {
  return (
    <Router>
      <Navbar/>
      <Routes>
        <Route path="/" element={<Navigate to="/movies-per-actor" />} />
        <Route path="/movies-per-actor" element={<MovieList />} />
        <Route path="/actors-with-multiple-characters" element={<ActorList />} />
        <Route path="/characters-with-multiple-actors" element={<CharacterList />} />
        {/* Add a fallback route for undefined paths */}
        <Route path="*" element={<div>Page not found</div>} />
      </Routes>
    </Router>
  );
};

export default App;
